package com.abelhu.leet

import org.junit.Test

class Code76 {
    fun minWindow(s: String, t: String): String {
        var left = 0
        var right = 0
        var result = s
        while (right < s.length - 1) {
            // 扩大窗口
            while (right < s.length - 1 && !contains(s.slice(left..right), t)) right++
            // 减少窗口
            while (left <= right && contains(s.slice(left..right), t)) left++
            // 判断是否最优解
            result = if (right - left + 1 < result.length - 1) s.slice(left - 1..right) else result
        }
        return if (contains(s, t)) result else ""
    }

    private fun contains(s: String, t: String): Boolean {
        // 使用IntArray代替HashMap获取更高的执行效率
        val map = IntArray(64) { 0 }
        for (c in s) {
            map[c - 'A']++
        }
        for (c in t) {
            map[c - 'A']--
            if (map[c - 'A'] < 0) return false
        }
        return true
    }

    @Test
    fun test0() {
        // 最终的测试
        assert("BANC" == minWindow("ADOBECODEBANC", "ABC"))
    }

    @Test
    fun test00() {
        // 失败的测试用例
        assert("" == minWindow("a", "aa"))
    }

