    @Test
    fun test1() {
        assert(contains("qwer", "er"))
        assert(!contains("qwer", "rty"))
    }

    @Test
    fun test11() {
        assert(!contains("a", "aa"))
    }

    @Test
    fun test2() {
        assert("345" == "1234567".slice(2..4))
        assert("1" == "1234567".slice(0..0))
        assert("12" == "1234567".slice(0..1))
    }
}